import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Link } from 'react-router-dom';
import BreakfastTable from './components/BreakfastTable';
import CreatePage from './components/CreatePage';
import getBreakfastMockData from './utils/breakfastMockData';
import './assets/styles/main.css';
import './assets/styles/App.css';

function App() {
  const [formDataList, setFormDataList] = useState([]);
  const [makeTable, setMakeTable] = useState(false);

  useEffect(() => {
    if (makeTable) {
      const mockData = getBreakfastMockData();
      setFormDataList(mockData);
    }
  }, [makeTable]);

  const generateTable = () => {
    setMakeTable(!makeTable);
  };

  return (
      <div className="container">
        <h1 className="title">HTTP Request</h1>
        <Link to="/create-page">Create Page</Link>
        <CreatePage />
        <button className="btn" onClick={generateTable}>
          Make Table
        </button>
        {makeTable && <BreakfastTable formDataList={formDataList} />}
      </div>
  );
}

export default App;
